Gracias a los efectos de DJ podrs dar tu toque personal a las pistas

Anima a los invitados con los efectos de DJ. Los cuatro efectos diferentes crean el escenario perfecto para tu fiesta: Flanger crea un efecto de retumbante profundidad; WAH distorsiona el sonido; Isolator asla una banda de frecuencia especfica; y PAN barre el sonido en ambos altavoces. Los efectos de DJ, accesibles desde la aplicacin Fiestable, y el control de gestos, te permitirn ser de lo ms creativo con las listas de reproduccin para tus fiestas.

Sistema de altavoces de 3 vas para un sonido potente

Obtn todo el rango de frecuencias con el impactante sonido del sistema de altavoces de 3 vas. Con dos tweeters de 4 cm (1.6"), dos medios de 12 cm (4.7") y un woofer de 25 cm (9.8"), podrs escuchar agudos vibrantes, medios slidos y potentes graves en toda tu msica.

Activa los ajustes de fiesta con el control de gestos

Dale tu propio toque a la fiesta con un sencillo movimiento. El control de gestos divertido e intuitivo te permite tomar el mando de todas las funciones de fiesta, incluyendo la iluminacin, efectos de DJ y efectos de sonido del micrfono. Tambin puedes deslizar hacia la izquierda o derecha para pasar de cancin y controlar el volumen. Personalizar tu fiesta nunca haba sido tan divertido.

Funciones de karaoke para que tambin cantes

Organizar concursos de karaoke con tus amigos es de lo ms sencillo: conecta el MHC-V7D a un televisor e introduce un DVD de karaoke, o canta canciones de YouTube accediendo mediante Bluetooth. Las dos entradas de micrfono, la reserva de canciones, las puntuaciones y los efectos de sonido te permiten formar equipo con tus amigos para que cantis como un autntico grupo. El Karaoke-PON integrado incluso baja la voz del CD para que puedas cantar tus canciones favoritas.

MEGA BASS potencia tu lnea de graves

Pulsa el botn MEGA BASS para aumentar seriamente la potencia de las frecuencias bajas en tu msica. Para lograrlo, refuerza las lneas de bajo a fin de crear un sonido ms potente. Pulsa el botn para activar el modo y djate llevar por el contundente sonido de los graves.

